description:
Verenigde Staten 
Komedie 
91 minuten 

geregisseerd door Bob Odenkirk 
met Will Arnett, Chi McBride en Will Forte 

Een stel sympathieke, maar niet al te snuggere broers proberen aan de wens van hun stervende vader te voldoen. Ze gaan hard op zoek naar de perfecte vrouw, om te proberen hun vader voor zijn dood nog grootvader te maken. Maar dit gaat niet zo makkelijk als ze in eerste instantie hadden gedacht.... 
